    para: 'hello my world',
    tableData: [
        {
            id: 1,
            name: 'john',
            prod: 'A'
        }
    ],
    features: {
        title: 'Features',
        data: [
            {
                img: '/img1',
                url: 'https://www.google.com/search?q=phone&tbm=isch&sxsrf=ALiCzsaf7_IUCJLX3I0HV1H9GFd0vZ8eYA%3A1664421408419&source=hp&biw=1920&bih=937&ei=IA41Y4y5Fvas4-EP2Zyc4Ag&iflsig=AJiK0e8AAAAAYzUcMNvwTnsdQK9iaBb2l-CSi1Q9vJeU&ved=0ahUKEwiMybX2hLn6AhV21jgGHVkOB4wQ4dUDCAc&uact=5&oq=phone&gs_lcp=CgNpbWcQAzIICAAQgAQQsQMyCAgAEIAEELEDMgsIABCABBCxAxCDATIICAAQgAQQsQMyCAgAEIAEELEDMggIABCABBCxAzIICAAQgAQQsQMyCAgAEIAEELEDMgUIABCABDILCAAQgAQQsQMQgwE6BwgjEOoCECc6CAgAELEDEIMBUJ4JWO8RYK0TaAFwAHgAgAHqAYgBjgaSAQUwLjQuMZgBAKABAaoBC2d3cy13aXotaW1nsAEK&sclient=img#imgrc=DsyIHdDDuwPsEM'
